(10408, '945ECA9F-725A-4CF3-A223-A09A302EE938', 'Love, I know music isn‚Äôt the place we connect, but I‚Äôve been trying to channel and make sense by working on a song. It‚Äôs kinda dark and there is some anger in it toward you, but please take as a snapshot in time, through a medium where I can safely, creatively work with thoughts and emotions. It may be a bit overwrought...but this is the raw unedited flow coming out of me. It‚Äôs called Bonfire.  In the morning  the animal spirits rise There was a choice to make How did  you decide?  He could write the book About flight 93 But the plane crashing Is lying next to me And you got your prize But who won? couldn‚Äôt get past  chapter one  Parallel lives can‚Äôt  Hold the same space When fragile promises  break   Can‚Äôt Fake it while i feel it   We‚Äôll make it to the other side I‚Äôll love you until my heart stops But that‚Äôs not what‚Äôs on the line The alchemy‚Äôs unstable As fire needs air  I wasn‚Äôt invited to the bonfire But we are here   When hurt turns to anger Fire will find air  Meet me there Bonfire  If you cut to the feeling It‚Äôs a dangerous thing Everything allowed Blame the wiring   But The way  you‚Äôre wired  Turns me on  Electrons  fire  Current‚Äôs strong My Circuits can only take so much Before they break  And our house burns up   Can‚Äôt Fake it while i feel it   Will we make it to the other side? I‚Äôll love you until my heart stops But that‚Äôs not what‚Äôs on the line The alchemy‚Äôs unstable As fire needs air  I wasn‚Äôt invited to the bonfire But we are here   When hurt turns to anger Fire will find air  Meet me there Bonfire  And it hurts to see it I missed 1000 signs As I rewrite history Which screen is real Who decides?   Fear of heights  Doesn‚Äôt mean I can‚Äôt  climb And you pushed me to my limits The Limits were just a lie In the story I told myself I need to leave that story behind        ', '623200889948678912', 'None', 1, 'David', 'Nitzan', 0, '', '', '', 'iMessage', 'e:nwdave@b